//s3.amazonaws.com/truffle-renditions/chocolate-cake-with-rosemary-buttercream_l4k_en/thumbnails/1080p-Thumbnail.png",ffmpeg_probe_data:null,workflow_status:"ready",upload_percentage:null,cc_scc_url:"https://s3.amazonaws.com/truffle-captions/en-us/21858.scc",cc_srt_url:"https://s3.amazonaws.com/truffle-captions/en-us/21858.srt",cc_vtt_url:"https://s3.amazonaws.com/truffle-captions/en-us/21858.vtt",cc_txt_url:"https://s3.amazonaws.com/truffle-captions/en-us/21858.txt",cc_text:"\ufeff- I am taking dirt cakes to the next level today. I've taken a basic chocolate cake and then layered it with butter cream that has been infused with rosemary. It is so good and so much fun to make and eat, let's get started. Okay, so we're gonna be making a pretty basic buttercream, but what makes it special is that before we put the butter into the buttercream, we're gonna infuse it with rosemary, and you're gonna have a pretty fancy chocolate cake. So, I have unsalted butter here that I'm just gonna put into this sauce pan, and we'll get that melted down, and if you wanna use other herbs, aside from rosemary, that would be really, really good too. If you're making this immediately, before you wanna frost the cake, you can have an ice bath ready to firm up your butter. Okay, so now that this is mostly melted, I'm gonna put my whole rosemary sprigs right into the butter and give it a little stir, and this really doesn't take that long, you only need to let the rosemary be in the butter for about 15 minutes. And now we have this beautiful rosemary butter that will firm up in the fridge before we get to making our frosting. And you can use that butter for other things too, you can spread it on bread or sprinkle some salt over it. So, I'm just gonna pour it into this bowl, and if you have any stray little sprigs of rosemary you can pour it through a strainer. You can just use your spatula to keep these larger sprigs in the pot, and these you can just discard. All right, so I have my rosemary-infused butter that I'm just gonna stick in the fridge to firm up, and then before we make our frosting we'll take it out and let it sit at room temperature so that it softens. All right, so we have our infused rosemary butter that has chilled and now softened a little bit, and I'm just gonna make a basic buttercream frosting with it. So, we have our butter and a big bowl, and just to get it softened and smooth, I'll beat it up a little bit before adding the other ingredients. Okay, so once my butter is nice and creamy, I'll just add my powdered sugar, beat that in gradually. Oh, it smells so good. And then, we'll add a little bit of salt. I always salt my buttercream just to bring out those flavors, and then some vanilla extract, and then a little bit of milk will add a nice smooth creaminess. Okay, so now we have a nice, beautiful rosemary buttercream. So, now we're gonna assemble our cake, but we're not gonna be frosting it like a traditional cake, we are going to be making a grown up dirt cake. So, I have my cooled cakes here, and I'm just gonna use my hands to crumble these up right to the bottom of the pot, and we're gonna layer it almost as if we're baking a trifle. And this is a really great way to use up maybe a cake that crumbled in your hands, or if it's a dry cake, this is a really nice way to kind of get the frosting mixed in throughout and it'll moisten that up and bring it back to life. So, I'm just putting down one nice little layer of cake into the bottom of my pot, and then we'll add a layer of buttercream right on top. We'll just pop it in, doesn't need to be perfect, and then you can spread it around on top of the cake, and then we'll layer on another layer of crumbled cake. And this is just your basic chocolate cake, you can use other flavors too if you want. Of course, you can use a vanilla cake, but I like chocolate because it looks like dirt. Okay, so we'll spread that around, and then we'll add another layer of chocolate cake in here. Okay,